import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component() {

  constructor() {
    super();
    this.state = {
      speed: 10
    };
  }

  render(){
    return (
      <div className="App">
        <h1>speed</h1>
      </div>
    );
  }



} //end of App()
export default App;
